	it("should detect that this is NO valid Jenkins URL", function(){
		var jenkinsUrl = 'http://some.invalid.jenkins.url';
		$httpBackend.expectGET('/api/get?url=' + encodeURIComponent(jenkinsUrl + "/api/json?depth=1&tree=mode")).respond(404, {});
		dataService.isValidJenkinsUrl(jenkinsUrl);
		$httpBackend.flush();
		expect(dataService.jenkinsData.urlIsValid).toBe(false);
		$httpBackend.expectGET('/api/get?url=' + encodeURIComponent('notLookingLikeUrl' + "/api/json?depth=1&tree=mode")).respond(404, {});
		dataService.isValidJenkinsUrl('notLookingLikeUrl'); // not causing an HTTP request...
		expect(dataService.jenkinsData.urlIsValid).toBe(false);
	});

	it("should detect that this is a valid Jenkins URL", function(){
		var jenkinsUrl = 'http://some.valid.jenkins.url';
		$httpBackend.expectGET('/api/get?url=' + encodeURIComponent(jenkinsUrl + '/api/json?depth=1&tree=mode')).respond(200, { mode: "NORMAL"});
		$httpBackend.expectGET('/api/get?url=' + encodeURIComponent(jenkinsUrl + "/api/json?depth=1&tree=views[name,url],jobs[name,url,color]")).respond(200, jenkinsMock);
		dataService.isValidJenkinsUrl(jenkinsUrl);
		$httpBackend.flush();
		expect(dataService.jenkinsData.urlIsValid).toBe(true);
	});

	it("should load the jenkins data for a specific jenkins url", function(){
		var jenkinsUrl = 'http://some.valid.jenkins.url';
		$httpBackend.expectGET('/api/get?url=' + encodeURIComponent(jenkinsUrl + "/api/json?depth=1&tree=views[name,url],jobs[name,url,color]")).respond(200, jenkinsMock);
		dataService.getJenkinsViewsAndJobs(jenkinsUrl);

		expect(dataService.jenkinsData.views.length).toBe(0);
		expect(dataService.jenkinsData.jobs.length).toBe(0);
		$httpBackend.flush();
		expect(dataService.jenkinsData.views.length).toBe(23);
		expect(dataService.jenkinsData.jobs.length).toBe(283);
	});

	it("should load the jenkins data for a specific jenkins view", function(){
		var jenkinsUrl = 'http://some.valid.jenkins.url';
		$httpBackend.expectGET('/api/get?url=' + encodeURIComponent(jenkinsUrl + "/api/json")).respond(200, jenkinsJobsForViewMock);

		dataService.getJenkinsJobsForView(jenkinsUrl);
		expect(dataService.jenkinsData.jobsForView.length).toBe(0);
		$httpBackend.flush();
		expect(dataService.jenkinsData.jobsForView.length).toBe(13);
	});
